import '../../App.css';
import Formulario from './formulario'
export default class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.myRef = React.createRef();
  }
  componentDidMount () {
  
    
}
componentWillUnmount(){



}

irasection(sectionid){
  const trackButton = useRef();
  trackButton.hola.scrollIntoView(); 
}

  render(){
    return(
    <div className="App">

        <div >
            

            <div className="wave-containerkoi">
            
                <div className="logokoi">
                <h1 className="textokoi">Koinonia 2021 est√° cerca, reserva o cancela tu boleto</h1>
                <h3 className="textokoi2">El evento que todos estan esperando y adaptandonos a lo digital. Ministerio Evangelico El Aposento Alto. Koinonia 2021</h3>
               

                <div id="containerkoi">
                  <button hclassName="learn-more" onClickO={this.irasection("formularirs")}>
                    <span className="circle" aria-hidden="true">
                      <span className="icon arrow"></span>
                    </span>
                    <span className="button-text" >RESERVAR</span>
                    
                  </button>
                  <button className="learn-more">
                    
                    <span className="button-text">VERIFICAR</span>
                    
                  </button>
                  
                </div>

                </div>

                
                
            </div>
            
            <section ref="hola"  id="sectionkoireserva">

                <div className="headerolas">

                  <div className="inner-header flex">

                
                  <Formulario/>

                  </div>

                  <div>
                  <svg className="waves" xmlns="http://www.w3.org/2000/svg" 
                  viewBox="0 24 150 28" preserveAspectRatio="none" shape-rendering="auto">
                  <defs>
                  <path id="gentle-wave" d="M-160 44c30 0 58-18 88-18s 58 18 88 18 58-18 88-18 58 18 88 18 v44h-352z" />
                  </defs>
                  <g className="parallax">
                  <use href="#gentle-wave" x="48" y="0" fill="rgba(8,1,37,0.7" />
                  <use href="#gentle-wave" x="48" y="3" fill="rgba(8,1,37,0.5)" />
                  <use href="#gentle-wave" x="48" y="5" fill="rgba(8,1,37,0.3)" />
                  <use href="#gentle-wave" x="48" y="7" fill="#15035f " />
                  </g>
                  </svg>
                  </div>
                  <div className="contenidoolas flex">
                  <p>Yamir Mena | 2021 | MEEAA</p>
                  </div>
                  </div>
                 
            </section>
        </div>

      
    </div>
  );
} }
